Sabtu, 23 Agustus 2025

Perayaan Gebyar Kemerdekaan RW 004 Jatirangga berlangsung sangat meriah dengan berbagai rangkaian kegiatan. Salah satu yang paling menarik perhatian adalah ngarak goong dan tabuh lesung, tradisi penuh makna yang melambangkan kekompakan, persatuan, dan semangat gotong royong warga Jatirangga. Suasana kebersamaan dan antusiasme begitu terasa, mencerminkan semangat kemerdekaan yang selalu hidup di tengah masyarakat.

Kemeriahan acara ini semakin lengkap dengan kehadiran Wali Kota Bekasi, Bapak Dr. Tri Adhianto Tjahyono, bersama Camat Jatisampurna, Sekretaris Camat Jatisampurna, Lurah Jatirangga beserta unsur 3 Pilar, Sekretaris Kelurahan Jatirangga, Kasi Pemtrantibum, tokoh masyarakat, tokoh adat se-Kelurahan Jatirangga, serta seluruh warga RW 004 Jatirangga.

